    public double sendBytePost(byte[] payload, String url){
        //bytes send
        return send(url,payload,false);
    }

    public double sendPostParams(byte[] payload, String url,String request){
        //bytes send
        request = request.replace("params[","");
        String[] substrings = request.split("\\$payload\\$");
        byte[] payloadFinal = new byte[payload.length+request.length()];
        byte[] substringFirst = substrings[0].getBytes();
        if(substrings.length==2) {
            byte[] substringSecond = substrings[1].getBytes();
            System.arraycopy(substringFirst, 0, payloadFinal, 0, substrings[0].length());
            System.arraycopy(payload, 0, payloadFinal, substringFirst.length, payload.length);
            System.arraycopy(substringSecond, 0, payloadFinal, payload.length + substrings[0].length(), substrings[1].length());
        } else {
            System.arraycopy(substringFirst, 0, payloadFinal, 0, substrings[0].length());
            System.arraycopy(payload, 0, payloadFinal, substringFirst.length, payload.length);
        }

        return send(url,payloadFinal,false);
    }
    public double send(String url,byte[] payload,boolean json){
        WebClient webClient;
        if(json) {
            webClient = WebClient.builder()
                    .baseUrl(url)
                    .defaultHeader(HttpHeaders.CONTENT_TYPE, MediaType.APPLICATION_JSON_VALUE)

                    .build();

        } else {
            webClient = WebClient.builder()
                    .baseUrl(url)
                    .defaultHeader(HttpHeaders.CONTENT_TYPE, MediaType.APPLICATION_FORM_URLENCODED_VALUE)

                    .build();

        }
        long start = System.nanoTime();
        try {
            webClient.post()
                    .uri("")
                    .header(HttpHeaders.CONTENT_LENGTH, String.valueOf(payload.length))
                    .body(BodyInserters.fromValue(payload))
                    .retrieve()
                    .bodyToMono(String.class)
                    .onErrorContinue(IOException.class, (ex, v) -> Mono.just("error"))
                    .timeout(Duration.ofSeconds(12))
                    .block();
        } catch (Exception ex) {
            System.out.println(ex.toString());
        }
        long stop = System.nanoTime();
        return TimeUnit.SECONDS.convert(stop-start,TimeUnit.NANOSECONDS);

    }
    public double sendPostRequest(byte[] payload, String url,String request){
        //bytes send
        String[] substrings = request.split("\\$payload\\$");
        byte[] payloadFinal = new byte[payload.length+request.length()];
        byte[] substringFirst = substrings[0].getBytes();
        if(substrings.length==2) {
            byte[] substringSecond = substrings[1].getBytes();
            System.arraycopy(substringFirst, 0, payloadFinal, 0, substrings[0].length());
            System.arraycopy(payload, 0, payloadFinal, substringFirst.length, payload.length);
            System.arraycopy(substringSecond, 0, payloadFinal, payload.length + substrings[0].length(), substrings[1].length());
        } else {
            System.arraycopy(substringFirst, 0, payloadFinal, 0, substrings[0].length());
            System.arraycopy(payload, 0, payloadFinal, substringFirst.length, payload.length);
        }

        return send(url,payloadFinal,true);
    }

